 Sure! Here's an example of a script using JavaScript and threejs to loop a camera transform in the z-axis over 10 seconds:

let scene, camera, renderer;
let zIndex = 0;
let deltaTime = 0;

function init() {
    scene = new THREE.Scene();
    camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
    renderer = new THREE.WebGLRenderer();
    renderer.setSize(window.innerWidth, window.innerHeight);
    document.body.appendChild(renderer.domElement);
}

function animate() {
    requestAnimationFrame(animate);
    renderer.render(scene, camera);

    // Camera transform looping logic
    deltaTime += 0.01;
    zIndex = Math.sin(deltaTime) * 5;

    const rotation = new THREE.Euler(0, 0, zIndex); 

    camera.rotation.setFromVector3(rotation);

    if (deltaTime > 10) { // Reset after 10 seconds 
        deltaTime = 0; 
    }    
}

init(); 
animate();

