 Sure, I can create a data visualization in three.js. Here is the code: 
```
// Get the blockchain nodes data
var blockchainData = getBlockchainData();

// Create a 3D hemisphere geometry to represent the blockchain nodes
var sphere = new THREE.SphereGeometry(1, 32, 32);

// Create an emissive material to represent each node
var material = new THREE.MeshBasicMaterial({ color: 0xffffff, emissive: 0x888888 });

// Create a mesh for each node and position it in 3D space 
for (var i = 0; i < blockchainData.length; i++) {
  var nodeMesh = new THREE.Mesh(sphere, material);

  // Position the mesh based on its reported coordinates 
  nodeMesh.position.set(blockchainData[i].x, blockchainData[i].y, blockchainData[i].z);

  // Add the mesh to the scene
  scene.add(nodeMesh);
}
```

